import React from "react";
import logo from "./logo.svg";
import "./App.css";
import Navbar from "./Components/Navbar";
import AboutSection from './Components/Sections/AboutSection';
import dummyText from "./DummyText";
import PhilantrophySection from "./Components/Sections/Philantrophy";

const App = () => {
    return (
      <div className="App">
        <Navbar />
        <ServicesSection/>
        <AboutSection/>
        <PhilantrophySection/>
        <Section
          title="About"
          subtitle={dummyText}
          dark={false}
          id="section2"
        />
        <Section
          title="Philantrophy"
          subtitle={dummyText}
          dark={true}
          id="section3"
        />
      </div>
    );
}

export default App;
